RecipeInstructions:
c("On a clean work surface, add flour and form a well. Add eggs, oil and salt in the center of it. Slowly incorporate the flour while beating the egg mixture.", "When mostly mixed, gather the ingredients together by hand and start forming a ball. Knead the dough for 5 minutes and if itâ€™s dry and crumbly, add a little bit of water until smooth. Form a disc and wrap it tightly in cling film before transferring it to the fridge for a couple of hours or up to 24 hours.", "Flour the work surface before adding the chilled dough; lightly sprinkle the dough with flour. Using a rolling pin, flatten it out to an oval shape long and wide enough to fold it like an envelope, taking one side and folding it over halfway and then do the same with the other side. Sprinkle on more flour and roll it down to a thickness of about 3/8-inch.", 
"Set the pasta machine to the widest setting (0) and feed the dough through the rollers. Cut the dough length in half and fold each half into an envelope shape; sprinkle lightly with flour. Run it through the machine 3 more times. After the 4th time, change the setting to 1 and run it through once. Change the setting to 2 and run it through once again. Continue doing this with each higher setting until you get to the desired thickness.", "Cut pasta in half and dust pieces on both sides with flour and spread evenly. Feed each piece of dough through the cutters on the pasta machine. Place them on a pasta drying rack, separating the noodles or use them right away. Makes 12 ounces."
)

c("Preheat the oven to 350.", "Grease and sugar a bundt pan and set aside.  (can also use an Angle tube or 2 large loaf pans)  Grease the pan very well making sure to get any nook and cranny and use cane sugar to fully coat the inside.  You can also use cooking spray if you do not want the sugar crust.", "Sift together dry ingredients and set aside.", "Cream sugar and butter until smooth.", "Mix in one egg at a time.", "Mix in vanilla.", "Mix in pumpkin on low speed until fully blended.", "Slowly mix in dry ingredients until fully incorporated.", 
"Pour into your prepared pan.  The mixture will be very thick so spread it to evenly distribute it around the pan.", "Bake at 350 for 1 hour and then do a toothpick check.  It may need more time but you do not want to over cook it.  When your toothpick comes out clean take it out of the oven.", "Let stand about 10 minutes until cake starts to pull away from the sides of the pan.   Turn out on a cooling rake and let cool completely.  If you have sugared the pan it will form a crisp crust on the outside of the cake."
)

c("Pat dry the filets with paper towels and season generously with salt and pepper; set aside.", "In a large cast iron skillet over medium-high heat, add oil and butter. When hot, add steaks and cook until browned turning only once, about 1 Â½ to 2 minutes per side for medium-rare. Transfer to a plate and cover loosely with foil.", "In the same skillet, reduce heat to medium, add garlic and shallots; sautĂ© for 30 seconds. Add mushrooms, season with salt and pepper; stir well and cook for 2 minutes.", 
"Pour in Cog0c, wait 2 seconds and then ignite; cook until the flame dies down. Add demi-glace, heavy cream, Dijon mustard, Worcestershire sauce and hot sauce; stir well and cook for 3 minutes.", "Return the filet mignon to the skillet including the juices accumulated while resting and spoon mushroom sauce over to warm them up. After about 1 Â½ minutes, transfer the steak to warm serving plates while finishing the sauce.", "Add chives and parsley to the sauce; stir quickly and then pour sauce over steaks. Serves 2."
)

c("Prepare 150g sweet potato cube and 100g yam cube. (1cm to 1.5cm cube).", "Cover and steam for 20 minutes or until soften.", "Preheat oven to 170Â°C.", "Crush biscuit into crumbs.", "Mix melted butter, biscuits and sugar until evenly moistened.", "Line 20cm springform cake tin with a square baking paper. Press mixture into the bottom of the pan.", "Bake the crust for 10 minutes. Cool on rack.", "For the filling, increase the oven temperature to 200Â°C. Mix all ingredients for filling until blend.", 
"Brush sides of springform tin with butter and put on a baking sheet. Brush again the inner sheet. Pour in the filling.", "Bake for 10 minutes.", "Reduce oven temperature to 90Â°C and bake for 30 minutes more.", "Turn off the oven and leave it closed for an hour.", "Open the oven door and let it cool in the oven for an hour more.", "Cut cheesecake into 6 pieces with a string. Combine all ingredients for topping. Spread over the cheesecake right to the edges. Enjoy immediately or refrigerate overnight."
)

c("In a 10 or 12 inch casti ron skillet, cook chopped bacon over medium heat until crispy (about 10 to 15 minutes).  While bacon is cooking you can prep all of the other ingreients.", "When the bacon is crispy, remove to a paper towel-lined plate to drain.  Pour off all but a tablespoon of bacon grease and sae the rest for later in the recipe.", "Add potatoes and onion and cook for about 10 minutes or until golden brown and potatoes are cooked through, stirring occasio0lly.", "Add in a little more bacon grease if needed and then add in shrimp and tomatoes.  Cook shrimp for 45 seconds per side for medium-sized shrimp.  Adjust cook time based on size of shrimp.", 
"Remove shrimp and tomatoes to a second bowl.  Reduce heat to medium-low, add in a little more grease if needed, then crack 4 eggs into the skillet.  Do not stir.  Cook for 1 minute or until whites are almost set.", "Spoon bacon, potatoes, onions, shrimp, and tomatoes around the eggs.", "Taste and season with salt and pepper, if needed.  I didn't add any salt--just pepper.", "Sprinkle with cheese and turn off the burner.  Let the skillet sit on the burner for about a minute.", "Garnish with avocado, cilantro, and green onions."
)

c("Begin by preparing the Greek dressing; half will be used as the chicken mari0de.", "Combine the dressing ingredients in a large canning jar, place on the lid and shake vigorously to emulsify. Alter0tely, add dressing ingredients into a bowl and whisk until combined.", "Pour exactly HALF of this dressing over the chicken in a medium bowl or Ziplock bag, then rub to get coat on all sides. Reserve remaining dressing.", "Allow to mari0te for at least 30 min in the refrigerator. Discard this used part of the mari0de before cooking the chicken.", 
"To cook the chicken, heat a large skillet or grill pan over medium heat. Drizzle pan with oil, then add in the chicken and cook for about 4 - 5 minutes per side, or until nicely browned and just cooked through. Set cooked chicken aside on a plate to rest for 10 minutes. Slice into strips.", "In a large bowl, combine the tomatoes, cucumber, olives, onion and feta cheese.", "Drizzle the reserved dressing over the top and gently toss vegetables and feta to combine. To assemble bowls, add a 1/2 cup cooked rice to four bowls. Top the rice equally with the Greek salad and sliced chicken."
)

c("Prepare Hollandaise sauce and keep it warm on the back burner at low temperature while cooking the other ingredients. In a large pot, add vinegar and bring water to a boil.", "While the water gets boiling, place a griddle on medium heat. Add oil and 1 teaspoons clarified butter. Tilt the pan so the ingredients cover the entire bottom. When it gets hot, add English muffin halves pressing down slightly to adhere to the griddle; cook for 2 minutes or until golden. Flip and cook for an additio0l 2 minutes. Transfer on plates and set aside.", 
"Add the remaining teaspoons of butter and cook back bacon for 2 to 2 Â½ minutes or until golden. Flip and cook for another 2 to 2 Â½ minutes. Place each slice on top of an English muffin half; set aside.", "Crack each egg in a ramekin or small bowl. When water is boiling, stir quickly to create a vortex (it prevents the white from spreading) and drop egg in the whirlpool; poach for 2 minutes. Using a slotted spoon, remove egg and place it on top of the Ca0dian back bacon. Spoon on the warm Hollandaise sauce and sprinkle with paprika. Makes 4 eggs benedict."
)

c("Preheat oven to 325ÂºF. Season short ribs with salt and pepper on all sides; set aside. In a large Dutch oven over medium-high heat, add oil and butter. When hot, place short ribs and cook until caramelized on all sides. Transfer on a plate and set aside.", "In the same pot, add onion, reduce heat to medium and sautĂ© until soft, about 5 minutes. Add shiitake mushrooms and cook for 3 minutes, stirring constantly to prevent from burning. Add garlic and sautĂ© for 1 minute. Stir in flour to coat ingredients. Pour in beef broth and cooking sherry; scrap any bits at the bottom. Stir in tomato paste, rosemary, balsamic vinegar and cayenne.", 
"Bring it back to a simmer on medium-high. Place short ribs back and pour more broth over enough to cover meat. Cover and transfer to the preheated oven. Braise for 2 hours or until ribs are fork-tender.", "Remove from heat and transfer short ribs on a plate while working on sauce.", "Put heat on medium and skim off fat on the surface. When simmering, pour in cornstarch mixture and stir until sauce thickens, less than a minute. Taste and adjust seasoning if necessary. Place short ribs over mashed potato, ladle sauce over and sprinkle fresh parsley on top. Makes 4 servings."
)

c("In a small bowl, combine all the sauce ingredients. Whisk until well blended and set aside.", "In a large bowl, soak rice noodles according to the packageâ€™s instructions.", "In a wok or deep skillet over medium-high heat, add 2 tablespoons oil. When hot, add chicken pieces and spread them in a single layer. Let them sit, undisturbed, for 30 seconds then quickly sautĂ© until the pink color is almost gone. To this, add green onions and keep stirring for 30 seconds, scraping the bottom of the pan if needed. Add prawns and sautĂ© until just turning pink. Add ginger and garlic; continue stirring until prawns are nicely pink, about one minute.", 
"Push all the ingredients on one side of the skillet and pour in the beaten eggs. Let it sit until the edges start to cook and quickly stir until scrambled, about 1 minute. Incorporate all the ingredients together before transferring them to a bowl.", "Return skillet on the burner, reduce heat to medium and add the remaining 2 tablespoons oil. When hot, add drained rice noodles and stir until soft. If they stick at the bottom of the pan, add Â¼ cup water.", "When fairly soft, return chicken/prawn mixture back to the skillet. Reduce heat to medium-low and add sambal oelek and pad Thai sauce; stir until well coated and cook for 3 minutes. Add bean sprouts and stir until incorporated. Add 1 tablespoons roasted peanuts and stir once again before removing the skillet from the heat. Sprinkle on chives and more peanuts and serve with lime wedges. Makes 4 servings."
)

c("Cook the potatoes in boiling water until tender. Drain thoroughly and return to the pot.  Mash the potatoes using a potato masher and add 1/2cup milk and butter making sure that the liquids are absorbed into the potatoes. Add the remaining Â¼ cup milk if the potatoes seem dry. Add poultry seasoning salt and pepper to taste. Set aside.", "In a large skillet, heat oil over medium heat. Add onions, and cook, stirring occasio0lly, until translucent, about 6 minutes. Add the celery, carrots, poultry seasoning salt, and pepper, and cook, stirring occasio0lly 5 minutes. Add the butter; when itâ€™s melted, stir in the flour. Cook 1 to 2 minutes.", 
"Increase the heat to high and add the chicken stock, and bring to a boil; then reduce the heat to low and cook, stirring, 5 minutes.", "Stir in the cream, chicken, corn and peas. Remove from the heat and add the parsley. Pour the mixture into a medium-size (about 6 cup) baking dish.", "Gently spread the mashed potato over the top.", "The casserole can be made several hours ahead of time up to this point; cover and refrigerated.", "Preheat your oven to 350Â° and set a rack to the middle position. Bake until the top is golden brown and the filling is bubbling, 30 to 40 minutes."
)

c("In a large mixing bowl, combine oats, 1 cup coconut flakes and salt; mix and set aside.", "In a medium saucepan over medium heat, add butter, milk, sugar, cocoa powder and egg. Whisk well and bring to a boil. When it gets there, stir vigorously for 30 seconds before removing from the heat. Pour in rum and vanilla extract; stir well.", "Pour the cocoa mixture into the oat mixture and stir until well blended. Cover with plastic wrap, making sure it touches the surface, and chill for 2 hours or up to 24 hours.", 
"Meanwhile, in the bowl of a food processor, add the remaining cup of coconut flakes and process until flakes are finer. Transfer to a pie plate and set aside.", "Line a large baking sheet with parchment paper; set aside.", "Using a melon baller or a small 1-tablespoon ice cream scoop, form cocoa mixture into small balls before rolling them in fine coconut flakes. Place on prepared baking sheet and transfer to the fridge for at least 1 hour. Keep for 3 days covered at room temperature or fridge for 1 week."
)

c("Line a 9X13\" baking pan with foil and lightly spray with Pam (cooking spray), set aside.", "Using a 4-quart glass microwave-safe bowl melt butter in microwave. Remove bowl and add brown sugar, corn syrup and sweetened condensed milk and stir until well blended. Scrape down sides of bowl so no sugar crystals remain on sides. Microwave on high for 4 minutes.", "Remove bowl with oven mitts. Stir and then scrape down sides of bowl again. Microwave for 4 more minutes. Remove bowl with oven mitts and stir then scrape down sides of bowl again.", 
"Microwave for only 3 more minutes. Remove bowl with oven mitts. Do not stir or scrape down sides yet.", "Stand away from bowl and add vanilla (mixture may bubble a lot). Stir in vanilla and add nuts, if desired. Scrape down sides and pour into prepared pan with aluminum foil.", "Cool 3-4 hours or until moderately firm. Flip pan upside down onto a cutting board covered in wax or parchment paper and remove foil. Cut into 1-inch squares (I found my pizza cutter works best, you may need to spray Pam on knife or pizza cutter). Wrap each piece individually in a small piece wax paper, twisting each end of paper. Stores a very long time in refrigerator or weeks at room temperature."
)

c("Preheat oven to 325Â°F and line two large cookie sheets.", "In a large bowl, or (preferably) the bowl of a stand mixer, beat together the butter and mint oil (see note) until fully softened.", "Add the flour and icing sugar and, starting on low, begin to combine everything. Beat for 8-10 minutes (yes, really), gradually increasing the speed. It will go from crumbly to resembling fluffy buttercream.", "In the last minute of beating, add a couple of tablespoons of sprinkles, if using, and the chocolate chips.", 
"Scrape down the bowl and with a small disher or teaspoon, drop balls of dough onto the lined pans, a couple of inches apart. Top with remaining sprinkles, if desired.Â .", "Bake one pan at a time for 12 minutes, or until the bottoms are just brown.", "Let the cookies cool on the pan for a few minutes before carefully transferring them to a wire rack.", "Store between sheets of wax paper in an airtight container for up to a couple of weeks.", "NOTE - Make sure you use peppermint oil for this recipe and not extract. Oil is far more concentrated and will not add moisture (which would be detrimental to the outcome)."
)

c("Line bottom and sides of 5-quart oval slow cooker with single sheet of cooking parchment paper, and spray with cooking spray.", "In medium bowl, stir first five ingredients until crumbly. Set aside.", "In large bowl, stir Cake ingredients (cake mix, sour cream, butter, eggs) until blended. Pour into slow cooker. Place folded, clean dish towel under cover of cooker. This will prevent condensation from dripping down onto cake. Cook on High heat setting 1 hour. Carefully remove slow cookerâ€™s ceramic insert, and rotate insert 180 degrees. Sprinkle topping over cake. Replace cover with dish towel under the cover. Continue to cook on High heat setting 30 minutes to 1 hour or until toothpick inserted in center comes out clean.", 
"Transfer ceramic insert from slow cooker to cooling rack. Let stand 10 minutes. Using parchment paper, carefully lift cake out of ceramic insert, and transfer to cooling rack. Cool completely, about 1 hour. Remove parchment paper.", "In small bowl, beat powdered sugar, milk and vanilla until smooth. Drizzle over cake.", "For an even easier version, you can skip the glaze, and sprinkle powdered sugar on top of cooled cake.", "If preferred, 1/2 cup chopped toasted walnuts or pecans can be mixed into the topping mixture."
)
